children.text:
body { white-space: nowrap; }


body, #test { counter-reset: c 0 f 1000; }
p, #test span { counter-increment: c; }
#test span:before {
  content: counters(c, ".");
  content: counters(f);
  content: counters(f, decimal);
  content: counters(f, decimal, ".");
  content: counters(f, ".", decimal, decimal);
  content: counters(f, ".", decimal, ".");
  content: counters(f, ".", unknowntype);
}
